import React, {useState} from "react";
import "./downtime.css";
import Carousing from "./carousing";
import Crafting from "./crafting";
import Crime from "./crime";
import Gambling from "./gambling";
import PitFighting from "./pit-fighting";
import Relaxation from "./relaxation";
import ReligiousService from "./religious-service";
import Research from "./research";
import MonsterHunting from "./monster-hunting";
import Scribing from "./scribing";
import SellingMagicItems from "./selling-magic-items";
import Training from "./training";
import TrainingAnimals from "./training-animals";
import Work from "./work";
import SpellwroughtTattoos from "./spellwrought-tattoos";
import carousing_bg from "../../images/carousing.png"

  
function Downtime(){
    return(
        <div className="downtime-container">
            <h2> Downtime Activities </h2>
            <hr></hr>
            <div className="downtime-list">
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
                <div className="downtime-card"> </div>
            </div>
        </div>
    )
}

export default Downtime;
